  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lake Bowdoin
  NWR outlines Refuge accomplishments from November, 1941 through January, 1942. The
  report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, fish, and disease- is also covered. The Refuge development
  and maintenance section discusses physical developments and collections and receipts.
  The public relations section of the report describes recreational uses and Refuge
  visitors. N-R forms, photographs, updates on the easement refuges, and newspaper
  articles are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
